  true,\n\t\"url\": null,\n\t\"notes\": \"The NIST machine-printed database contains
  gray scale and binary images of machine printed pages. rnrn There are a total of
  3,063,168 characters in the set which is an average of 8,509 characters per page.
  rnrn A reference file is included for each page. These reference files are the ASCII
  text pages that were used to generate the original hardcopy that was digitized.
  rnrn This database is being distributed for use in the development and testing of
  Optical Character Recognition (OCR) systems on a common set of images. This allows
  vendors to report results with respect to this common image set.\",\n\t\"license_title\":
